import React from "react";

function Experiences (props) {
    return (
       <div>
            <div className='ExpContent' style={{display:"flex"}}>
                <p className='ExpNames'>{props.name}</p>
                <p className='ExpNames' >{props.year}</p>
            </div>

            <div>
                <hr/>
            </div>
       </div> 
    )
}

export default Experiences
